        LOOP(Sfe7, 1,2,1)

        Sub190(HelAll(Gen(2)),Gen(5),Gen(6),Neu(3),Sfe7,Sfe8) = 
     &   -((Sub105(HelAll(Gen(2)),Neu(3),Sfe8)*
     &         Sub107(HelAll(Gen(5)),Gen(6),Sfe7,Sfe8))/
     &       (U - Sub145(Gen(2),Sfe8))) + 
